ockconfirm','s:40:\"Yes, I really want to lock the database.\";'),('en','messages:unlockconfirm','s:42:\"Yes, I really want to unlock the database.\";'),('en','messages:lockbtn','s:13:\"Lock database\";'),('en','messages:unlockbtn','s:15:\"Unlock database\";'),('en','messages:locknoconfirm','s:39:\"You did not check the confirmation box.\";'),('en','messages:lockdbsuccesssub','s:23:\"Database lock succeeded\";'),('en','messages:unlockdbsuccesssub','s:21:\"Database lock removed\";'),('en','messages:lockdbsuccesstext','s:120:\"The database has been locked.<br />\nRemember to [[Special:UnlockDB|remove the lock]] after your maintenance is complete.\";'),('en','messages:unlockdbsuccesstext','s:31:\"The database has been unlocked.\";'),('en','messages:lockfilenotwritable','s:116:\"The database lock file is not writable.\nTo lock or unlock the database, this needs to be writable by the web server.\";'),('en','messages:databasenotlocked','s:27:\"The database is not locked.\";'),('en','messages:lockedbyandtime','s:33:\"(by {{GENDER:$1|$1}} on $2 at $3)\";'),('en','messages:move-page','s:7:\"Move $1\";'),('en','messages:movepage-summary','s:0:\"\";'),('en','messages:move-page-legend','s:9:\"Move page\";'),('en','messages:movepagetext','s:904:\"Using the form below will rename a page, moving all of its history to the new name.\nThe old title will become a redirect page to the new title.\nYou can update redirects that point to the original title automatically.\nIf you choose not to, be sure to check for [[Special:DoubleRedirects|double]] or [[Special:BrokenRedirects|broken redirects]].\nYou are responsible for making sure that links continue to point where they are supposed to go.\n\nNote that the page will <strong>not</strong> be moved if there is already a page at the new title, unless the latter is a redirect and has no past edit history.\nThis means that you can rename a page back to where it was renamed from if you make a mistake, and you cannot overwrite an existing page.\n\n<strong>Warning!</strong>\nThis can be a drastic and unexpected change for a popular page;\nplease be sure you understand the consequences of this before proceeding.\";'),('en','messages:movepagetext-noredirectfixer','s:801:\"Using the form below will rename a page, moving all of its history to the new name.\nThe old title will become a redirect page to the new title.\nBe sure to check for [[Special:DoubleRedirects|double]] or [[Special:BrokenRedirects|broken redirects]].\nYou are responsible for making sure that links continue to point where they are supposed to go.\n\nNote that the page will <strong>not</strong> be moved if there is already a page at the new title, unless it is a redirect and has no past edit history.\nThis means that you can rename a page back to where it was renamed from if you make a mistake, and you cannot overwrite an existing page.\n\n<strong>Warning!</strong>\nThis can be a drastic and unexpected change for a popular page;\nplease be sure you understand the consequences of this before proceeding.\";'),('en','messages:movepagetalktext','s:258:\"The associated talk page will be automatically moved along with it <strong>unless:</strong>\n*A non-empty talk page already exists under the new name, or\n*You uncheck the box below.\n\nIn those cases, you will have to move or merge the page manually if desired.\";'),('en','messages:movearticle','s:10:\"Move page:\";'),('en','messages:moveuserpage-warning','s:148:\"<strong>Warning:</strong> You are about to move a user page. Please note that only the page will be moved and the user will <em>not</em> be renamed.\";'),('en','messages:movenologintext','s:81:\"You must be a registered user and [[Special:UserLogin|logged in]] to move a page.\";'),('en','messages:movenotallowed','s:41:\"You do not have permission to move pages.\";'),('en','messages:movenotallowedfile','s:41:\"You do not have permission to move files.\";'),('en','messages:cant-move-user-page','s:68:\"You do not have permission to move us