wiki.org/wiki/Property properties] that are available and when filtered, only user-defined properties that match the condition are displayed. For a differentiated view, see the special page [[Special:UnusedProperties|unused properties]] or [[Special:WantedProperties|wanted properties]].\";'),('en','messages:smw-sp-properties-cache-info','s:123:\"The listed data have been retrieved from [https://www.semantic-mediawiki.org/wiki/Caching cache], and were last updated $1.\";'),('en','messages:smw-sp-properties-header-label','s:18:\"List of properties\";'),('en','messages:smw-sp-admin-settings-title','s:22:\"Configuration settings\";'),('en','messages:smw-sp-admin-settings-docu','s:247:\"Displays a list of all default and localized settings that are relevant to the Semantic MediaWiki environment. For details on individual settings, please consult the [https://semantic-mediawiki.org/wiki/Help:Configuration configuration] help page.\";'),('en','messages:smw-sp-admin-settings-button','s:22:\"Generate settings list\";'),('en','messages:smw-sp-admin-idlookup-title','s:15:\"ObjectId lookup\";'),('en','messages:smw-sp-admin-idlookup-docu','s:130:\"Displays details about an internal object Id that represents individual entities (wikipage, subobject etc.) in Semantic MediaWiki.\";'),('en','messages:smw-sp-admin-idlookup-objectid','s:10:\"Object Id:\";'),('en','messages:smw-livepreview-loading','s:10:\"Loading...\";'),('en','messages:smw-sp-searchbyproperty-description','s:313:\"This page provides a simple [https://www.semantic-mediawiki.org/wiki/Help:Browsing_interfaces browsing interface] for finding entities described by a property and a named value. Other available search interfaces include the [[Special:PageProperty|page property search]], and the [[Special:Ask|ask query builder]].\";'),('en','messages:smw-sp-searchbyproperty-resultlist-header','s:15:\"List of results\";'),('en','messages:smw-sp-searchbyproperty-nonvaluequery','s:54:\"A list of values that have the property \"$1\" assigned.\";'),('en','messages:smw-sp-searchbyproperty-valuequery','s:66:\"A list of pages that have property \"$1\" with value \"$2\" annotated.\";'),('en','messages:smw-datavalue-number-textnotallowed','s:65:\"\"$1\" can not be assigned to a declared number type with value $2.\";'),('en','messages:smw-editpage-annotation-enabled','s:558:\"This page supports semantic in-text annotations (e.g. <nowiki>\"[[Is specified as::World Heritage Site]]\"</nowiki>) to build structured and queryable content provided by Semantic MediaWiki. For a comprehensive description on how to use annotations or the #ask parser function, please have a look at the [https://www.semantic-mediawiki.org/wiki/Help:Getting_started getting started], [https://www.semantic-mediawiki.org/wiki/Help:In-text_annotation in-text annotation], or [https://www.semantic-mediawiki.org/wiki/Help:Inline_queries inline queries] help page.\";'),('en','messages:smw-editpage-annotation-disabled','s:232:\"This page is not enabled for semantic in-text annotations due to namespace restrictions. Details about how to enable the namespace is described on the [https://semantic-mediawiki.org/wiki/Help:Configuration configuration] help page.\";'),('en','messages:smw-editpage-property-annotation-enabled','s:472:\"This property can be extended using semantic annotations to specify a datatype (e.g. <nowiki>\"[[Has type::Page]]\"</nowiki>) or other supporting declarations (e.g. <nowiki>\"[[Subproperty of::dc:date]]\"</nowiki>). For a description on how to augment this page, see the [https://www.semantic-mediawiki.org/wiki/Help:Property_declaration declaration of a property] or the [https://www.semantic-mediawiki.org/wiki/Help:List_of_datatypes list of available data types] help page.\";'),('en','messages:smw-editpage-property-annotation-disabled','s:259:\"This property cannot be extended with a datatype annotation (e.g. <nowiki>\"[[Has type::Page]]\"</nowiki>) as it is already predefined (see the [https://www.semantic-mediaw